;; **
;;; # Lambda ML Example: Kaggle Digit Recognizer with Artificial Neural Networks
;;; 
;;; An example of applying artificial neural networks to the data from the [Digit Recognizer](https://www.kaggle.com/c/digit-recognizer) competition from Kaggle.
;; **

;; @@
(ns lambda-ml.examples.kaggle.digit-recognizer
  (:require [gorilla-plot.core :as plot]
            [gorilla-repl.image :as image]
            [clojure.data.csv :as csv]
            [clojure.math.numeric-tower :refer :all]
            [clojure.core.matrix :as m]
            [clojure.core.matrix.linear :as ml]
            [lambda-ml.core :refer :all]
            [lambda-ml.neural-network :refer :all]
            [lambda-ml.util :refer :all]))

(defn output->label
  [output]
  (first (apply max-key second (map-indexed vector output))))

(defn accuracy
  [model validation]
  (let [labels (map (comp output->label last) validation)
        predictions (->> (map (comp vec butlast) validation)
                         (neural-network-predict model)
                         (map output->label))]
    (float (/ (reduce + (map (fn [a b] (if (= a b) 1 0)) labels predictions))
              (count validation)))))

(defn write-output
  [alpha lambda layers iterations rows]
  (let [filename (str "output_digit_recognizer"
                      "_alpha" alpha
                      "_lambda" lambda
                      "_layers" (clojure.string/join "_" layers)
                      "_iters" iterations
                      ".csv")]
    (with-open [out (clojure.java.io/writer filename)]
      (.write out "ImageId,Label\n")
      (doseq [[id output] rows]
        (.write out (str (inc id) "," (output->label output)))
        (.newLine out)))))
