;; **
;;; Load training and test data.
;; **

;; @@
(defn encode-train
  [example]
  (let [x (mapv #(/ % 255.0) (rest example))
        y (-> (vec (replicate 10 0.0))
              (assoc (first example) 1.0))]
    (conj x y)))

(defn encode-test
  [example]
  (mapv #(/ % 255.0) example))

(def train-data
  (with-open [in (clojure.java.io/reader "resources/examples/kaggle/digit-recognizer/train.csv")]
    (doall
     (->> (rest (csv/read-csv in))
          (map #(map read-string %))
          (map encode-train)))))

(def test-data
  (with-open [in (clojure.java.io/reader "resources/examples/kaggle/digit-recognizer/test.csv")]
    (doall
     (->> (rest (csv/read-csv in))
          (map #(map read-string %))
          (map encode-test)))))
