(def lo (apply min (map #(apply min %) (first (:parameters nn)))))

(map #(-> (partition 28 (map (fn [x] (/ (- x lo) (- hi lo))) (rest %)))
          (pixels->image)
          (image/image-view :width 64))
     (first (:parameters nn)))
